--
-- Структура таблицы "car_model"
--

DROP TABLE IF EXISTS "car_model";
CREATE TABLE "car_model" (
  "id_car_model" serial primary key,
  "id_car_mark" int NOT NULL,
  "name" varchar NOT NULL check (length(name) <= 250 ),
  "date_create" timestamp DEFAULT NULL,
  "date_update" timestamp DEFAULT NULL,
  "int_date_create" int DEFAULT NULL,
  "int_date_update" int DEFAULT NULL,
  "id_object_type" int NOT NULL,
  "name_rus" varchar DEFAULT NULL check (length(name_rus) <= 250 )
); -- ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Модели автомобилей';

--
-- Дамп данных таблицы "car_model"
--


update car_model set date_create = to_timestamp(int_date_create);
update car_model set date_update = to_timestamp(int_date_update);

ALTER TABLE "car_model" drop column int_date_create;
ALTER TABLE "car_model" drop column int_date_update;

--
-- Индексы таблицы "car_model"
--
--drop index  if exists idx_car_model_name; 
create index idx_car_model_name on car_model("name");
--drop index  if exists idx_car_model_id_car_mark; 
create index idx_car_model_id_car_mark on car_model("id_car_mark");
--drop index  if exists idx_car_model_id_object_type; 
create index idx_car_model_id_object_type on car_model("id_object_type");


